import React, { Component } from 'react';

//TODO: also needs to pass the user information.

const initialState = {
	propertyID: '',
	property: {
		title: '',
		type: '',
		description: ''
	},
	rooms: {
		numGuest: 0,
		numBedroom: 0,
		numBed: 0,
		numBath: 0
	},
	reviews: []
};

class PropertyPage extends Component {
	constructor() {
		super();
		this.state = {
			propertyID: '',
			property: {
				title: '',
				type: '',
				description: ''
			},
			rooms: {
				numGuest: 0,
				numBedroom: 0,
				numBed: 0,
				numBath: 0
			},
			reviews: []
		};
	}

	componentDidMount() {
		//TODO: make a fetch to the api to get all the property information
		this.setState({
			propertyID: this.props.propertyID
		});
	}

	render() {
		const { property } = this.props;
		return (
			<div>
				<h1>Property Page</h1>
				<h3> {property.location} </h3>
				<h2> {property.title} </h2>
				<p> {`$${property.price} CAD/night`}</p>
				<p>{this.state.propertyID}</p>
			</div>
		);
	}
}

export default PropertyPage;
